import { useEffect } from 'react';
import * as messageActionTypes from '../dux/actionTypes';

interface MainProps {
  channelUrl: string;
  sdkInit: boolean;
}
interface ToolProps {
  sdk: SendbirdUIKit.Sdk;
  logger: SendbirdUIKit.Logger;
  messageSearchDispathcer: ({ type: string, payload: any }) => void;
}

function useSetChannel(
  { channelUrl, sdkInit }: MainProps,
  { sdk, logger, messageSearchDispathcer }: ToolProps,
): void {
  useEffect(() => {
    if (channelUrl && sdkInit && sdk && (sdk.OpenChannel || sdk.GroupChannel)) {
      sdk.GroupChannel.getChannel(channelUrl, (groupChannel, error) => {
        if (!error) {
          logger.info('MessageSearch | useSetChannel group channel', groupChannel);
          messageSearchDispathcer({
            type: messageActionTypes.SET_CURRENT_CHANNEL,
            payload: groupChannel,
          });
        } else {
          messageSearchDispathcer({
            type: messageActionTypes.CHANNEL_INVALID,
            payload: null,
          });
        }
      });
    }
  }, [channelUrl, sdkInit]);
}

export default useSetChannel;

import { useEffect } from 'react';
import * as messageActionTypes from '../dux/actionTypes';
import SendbirdUIKit from '../../../index';
import SendBird from 'sendbird';

interface MainProps {
  currentChannel: SendbirdUIKit.GroupChannelType;
  channelUrl: string;
  searchString?: string;
  messageSearchQuery?: SendbirdUIKit.MessageSearchQueryType;
  onResultLoaded?: (
    messages?: Array<SendBird.UserMessage | SendBird.FileMessage | SendBird.AdminMessage>,
    error?: SendbirdUIKit.SendbirdError,
  ) => void;
  retryCount: number;
}
interface ToolProps {
  sdk: SendbirdUIKit.Sdk;
  logger: SendbirdUIKit.Logger;
  messageSearchDispathcer: ({ type: string, payload: any }) => void;
}

function useGetSearchedMessages(
  { currentChannel, channelUrl, searchString, messageSearchQuery, onResultLoaded, retryCount }: MainProps,
  { sdk, logger, messageSearchDispathcer }: ToolProps,
): void {
  useEffect(() => {
    messageSearchDispathcer({
      type: messageActionTypes.START_MESSAGE_SEARCH,
      payload: null,
    });
    if (sdk && channelUrl && sdk.createMessageSearchQuery && currentChannel) {
      if (searchString) {
        const inputSearchMessageQueryObject = {
          ...messageSearchQuery,
          channelUrl,
          messageTimestampFrom: currentChannel.invitedAt,
        };
        const createdQuery = sdk.createMessageSearchQuery(searchString, inputSearchMessageQueryObject);
        createdQuery.next((messages, error) => {
          if (!error) {
            logger.info('MessageSearch | useGetSearchedMessages: succeeded getting messages', messages);
            messageSearchDispathcer({
              type: messageActionTypes.GET_SEARCHED_MESSAGES,
              payload: {
                messages,
                createdQuery,
              },
            });
            if (onResultLoaded && typeof onResultLoaded === 'function') {
              onResultLoaded(messages, null);
            }
          } else {
            logger.warning('MessageSearch | useGetSearchedMessages: getting failed', error);
            messageSearchDispathcer({
              type: messageActionTypes.SET_QUERY_INVALID,
              payload: null,
            });
            if (onResultLoaded && typeof onResultLoaded === 'function') {
              onResultLoaded(null, error);
            }
          }
        });
        messageSearchDispathcer({
          type: messageActionTypes.START_GETTING_SEARCHED_MESSAGES,
          payload: createdQuery,
        });
      } else {
        logger.info('MessageSearch | useGetSeasrchedMessages: search string is empty');
      }
    }
  }, [channelUrl, messageSearchQuery, searchString, currentChannel, retryCount]);
}

export default useGetSearchedMessages;

import { useCallback } from 'react';
import * as messageActionTypes from '../dux/actionTypes';
import SendbirdUIKit from '../../../index';

interface MainProps {
  currentMessageSearchQuery: SendBird.MessageSearchQuery;
  hasMoreResult: boolean;
  onResultLoaded?: (
    messages?: Array<SendBird.UserMessage | SendBird.FileMessage | SendBird.AdminMessage>,
    error?: SendbirdUIKit.SendbirdError,
  ) => void;
}
interface ToolProps {
  logger: SendbirdUIKit.Logger;
  messageSearchDispathcer: ({ type: string, payload: any }) => void;
}
type CallbackReturn = (
  callback: (
    messages: Array<SendBird.UserMessage | SendBird.FileMessage | SendBird.AdminMessage>,
    /* eslint-disable @typescript-eslint/no-explicit-any*/
    error: any,
  ) => void
) => void;

function useScrollCallback(
  { currentMessageSearchQuery, hasMoreResult, onResultLoaded }: MainProps,
  { logger, messageSearchDispathcer }: ToolProps,
): CallbackReturn {
  return useCallback((cb) => {
    if (!hasMoreResult) {
      logger.warning('MessageSearch | useScrollCallback: no more searched results', hasMoreResult);
    }
    if (currentMessageSearchQuery && currentMessageSearchQuery.hasNext) {
      currentMessageSearchQuery.next((messages, error) => {
        if (!error) {
          logger.info('MessageSearch | useScrollCallback: succeeded getting searched messages', messages);
          messageSearchDispathcer({
            type: messageActionTypes.GET_NEXT_SEARCHED_MESSAGES,
            payload: messages,
          });
          cb(messages, null);
          if (onResultLoaded && typeof onResultLoaded === 'function') {
            onResultLoaded(messages, null);
          }
        } else {
          logger.warning('MessageSearch | useScrollCallback: failed getting searched messages', error);
          cb(null, error);
          if (onResultLoaded && typeof onResultLoaded === 'function') {
            onResultLoaded(null, error);
          }
        }
      });
    } else {
      logger.warning('MessageSearch | useScrollCallback: no currentMessageSearchQuery');
    }
  }, [currentMessageSearchQuery, hasMoreResult]);
}

export default useScrollCallback;

